import React from 'react';
import styled from 'styled-components';

const FooterContainer = styled.footer`
  background-color: #333;
  color: white;
  padding: 20px;
  text-align: center;
  position: relative;
  bottom: 0;
  width: 100%;
  border-top: 1px solid #444;
`;

const Footer = () => (
  <FooterContainer>
    <p>&copy; 2024 Pousada Pinheira. Todos os direitos reservados.</p>
  </FooterContainer>
);

export default Footer;
